import React, {Component} from 'react'
import request from 'superagent'
import SignInform from '../components/molecules/SignInForm'

export default class SignInForm extends Component {
    constructor (props) {
        super(props)
    }

    render () {
        return (
            <div>
                <Nav />
                <SignInForm />
            </div>
        )
    }
}
